import'./Buttons.css'

function PrimaryButton(props) {
  return (
    <button >
      {props.children}
    </button>
  )
}

function SecondaryButton(props) {
    return (
      <div>
          {props.children}
      </div>
    )
  }

export default PrimaryButton;
export {SecondaryButton};
